import WorldMap from "./WorldMap";

function FullSizeMap({ isVisible, selectedCountries} ) {
    return (
        isVisible &&
            <div className="full-size-map-container">
                <WorldMap selectedCountries={selectedCountries ? selectedCountries[0] : null}  isFullSize={true}/>
            </div>
    )
}

export default FullSizeMap;
